import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Navigation from './components/navigation'

function App() {
  return (  


    <div className="App">

      <Navigation />



      <header className="App-header">
        <h4 headerTitleStyle>Welcome to Nursing Toolkit</h4>
        <p>This site was created by me to try an automate everyday tasks involved in nursing </p>
      </header>
    </div>



  );
}

export default App;
